pragma solidity >=0.4.21 <8.10.0;
pragma experimental ABIEncoderV2;

contract Aadhar {
    address public admin;

    struct Org_Education {
        string name;
        string org_id;
        bool isVerified;
        string location;
        string about;
        string physical_address;
        string email;
        string[] Docs; //Array of hashes
    }

    struct Org_Crime {
        string name;
        string org_id;
        bool isVerified;
        string location;
        string about;
        string physical_address;
        string email;
        string[] Docs; //Array of hashes
    }
    struct Org_Med {
        string name;
        string org_id;
        bool isVerified;
        string location;
        string about;
        string physical_address;
        string email;
        string[] Docs; //Array of hashes
    }

    struct Edu_data {
        address org_address;
        string org_name;
        string Description;
        string Hash; //hash of the doc
        uint256 timeStamp; //use "now" to store current time
    }

    struct Crime_data {
        address org_address;
        string Description;
        string Hash; //hash of the doc
        uint256 timeStamp; //use "now" to store current time
    }

    struct Med_data {
        address org_address;
        string org_name;
        string Description;
        string Hash; //hash of the doc
        uint256 timeStamp; //use "now" to store current time
    }
    struct Person {
        string name;
        string AadharNo;
        string Gender;
        Edu_data[] Educations;
        Crime_data[] Crimes;
        Med_data[] Medical;
    }

    mapping(address => Person) public address_person_map;
    mapping(address => Org_Education) public address_edu_map;
    mapping(address => Org_Crime) public address_crime_map;
    mapping(address => Org_Med) public address_med_map;

    mapping(address => bool) public exists_address_person_map;
    mapping(address => bool) public exists_address_edu_map;
    mapping(address => bool) public exists_address_crime_map;
    mapping(address => bool) public exists_address_med_map;

    mapping(address => bool) public verified_address_edu_map;
    mapping(address => bool) public verified_address_crime_map;
    mapping(address => bool) public verified_address_med_map;

    mapping(address => address) public person_to_edu_org;
    mapping(address => address) public person_to_crime_org;
    mapping(address => address) public person_to_med_org;

    constructor() public {
        admin = msg.sender;
    }

    function registerEduOrg(
        address org_address,
        string memory name,
        string memory org_id,
        string memory location,
        string memory about,
        string memory email
    ) public {
        // Check if exists
        Org_Education storage org = address_edu_map[org_address];
        org.name = name;
        org.org_id = org_id;
        org.location = location;
        org.about = about;
        org.email = email;

        exists_address_edu_map[org_address] = true;
    }

    function registerCrimeOrg(
        address org_address,
        string memory name,
        string memory org_id,
        string memory location,
        string memory about,
        string memory email
    ) public {
        Org_Crime storage org = address_crime_map[org_address];
        org.name = name;
        org.org_id = org_id;
        org.location = location;
        org.about = about;
        org.email = email;

        exists_address_crime_map[org_address] = true;
    }

    function registerMedOrg(
        address org_address,
        string memory name,
        string memory org_id,
        string memory location,
        string memory about,
        string memory email
    ) public {
        // Check if exists
        Org_Med storage org = address_med_map[org_address];
        org.name = name;
        org.org_id = org_id;
        org.location = location;
        org.about = about;
        org.email = email;

        exists_address_med_map[org_address] = true;
    }

    function registerPerson(
        address person_address,
        string memory name,
        string memory Gender,
        string memory AadharNo
    ) public {
        Person storage per = address_person_map[person_address];
        per.name = name;
        per.Gender = Gender;
        per.AadharNo = AadharNo;

        exists_address_person_map[person_address] = true;
    }

    function getPerson(address person_address) public view returns (Person memory){
        return address_person_map[person_address];
    }

    function getEduOrg(address org_address) public view returns (Org_Education memory){
        return address_edu_map[org_address];
    }

    function checkRole(address my_address) public view returns (uint256) {
        if(my_address == admin) {return 1;}
        if(exists_address_person_map[my_address] == true){ return 2; }
        if(exists_address_edu_map[my_address] == true){ return 3; }
        if(exists_address_med_map[my_address] == true){ return 4; }
        if(exists_address_crime_map[my_address] == true){ return 5; }
        return 0;
    }

    function addPersonDoc(
        address person_address,
        address org_address,
        string memory doc_hash,
        string memory Description
    ) public {
        require(
            verified_address_edu_map[org_address] ||
                verified_address_crime_map[org_address] ||
                verified_address_med_map[org_address],
            "ORGANISATION NOT VERIFIED!"
        );
        require(
            exists_address_person_map[person_address],
            "PERSON DOES NOT EXIST!"
        );
        Person storage per = address_person_map[person_address];

        if (verified_address_edu_map[org_address]) {
            Edu_data memory tempData = Edu_data(
                org_address,
                "some org name",
                Description,
                doc_hash,
                block.timestamp
            );
            per.Educations.push(tempData);
        }

        if (verified_address_crime_map[org_address]) {
            Crime_data memory tempData = Crime_data(
                org_address,
                Description,
                doc_hash,
                block.timestamp
            );
            per.Crimes.push(tempData);
        }
        if (verified_address_med_map[org_address]) {
            Med_data memory tempData = Med_data(
                org_address,
                "some org name",
                Description,
                doc_hash,
                block.timestamp
            );
            per.Medical.push(tempData);
        }
    }

    modifier onlyAdmin() {
        require(msg.sender == admin);
        _;
    }

    function verifyEduOrg(address org_address) public onlyAdmin {
        require(
            exists_address_edu_map[org_address],
            "ORGANISATION DOES NOT EXIST!"
        );
        Org_Education storage temporg = address_edu_map[org_address];
        temporg.isVerified = true;
        verified_address_edu_map[org_address] = true;
    }

    function verifyCrimeOrg(address org_address) public onlyAdmin {
        require(
            exists_address_crime_map[org_address],
            "ORGANISATION DOES NOT EXIST!"
        );
        Org_Crime storage temporg = address_crime_map[org_address];
        temporg.isVerified = true;
        verified_address_crime_map[org_address] = true;
    }

    function verifyMedOrg(address org_address) public onlyAdmin {
        require(
            exists_address_med_map[org_address],
            "ORGANISATION DOES NOT EXIST!"
        );
        Org_Med storage temporg = address_med_map[org_address];
        temporg.isVerified = true;
        verified_address_med_map[org_address] = true;
    }

    function addEduOrgDocs(address org_address, string memory hash)
        public
        onlyAdmin
    {
        require(
            verified_address_edu_map[org_address],
            "ORGANISATION  IS NOT VERIFIED!!"
        );
        Org_Education storage temporg = address_edu_map[org_address];
        temporg.Docs.push(hash);
    }

    function addCrimeOrgDocs(address org_address, string memory hash)
        public
        onlyAdmin
    {
        require(
            verified_address_crime_map[org_address],
            "ORGANISATION  IS NOT VERIFIED!!"
        );
        Org_Crime storage temporg = address_crime_map[org_address];
        temporg.Docs.push(hash);
    }

    function addMedOrgDocs(address org_address, string memory hash)
        public
        onlyAdmin
    {
        require(
            verified_address_med_map[org_address],
            "ORGANISATION  IS NOT VERIFIED!!"
        );
        Org_Med storage temporg = address_med_map[org_address];
        temporg.Docs.push(hash);
    }
    // function updatePersonDoc(address org_address, address person_address, string memory new_hash, string memory old_hash){
    //     return;
    // }
}
